var place;
var date;
var feld = 0;
var feldm = 0;
var imgData;
var wochentage = ['Sonntag','Montag','Dienstag','Mittwoch','Donnerstag','Freitag','Samstag' ];
var date_object;
var date_wochentag_zahl;
var date_wochentag;
var date_yyyy;
var date_mm;
var date_dd;
var date_gesamt;
var time;
var abstand = 123;
var read_topic_cache;
var SvVorstandFile = 'Textdateien laden mit JavaScript!';
var datei;
var inhalt;
var s ='';
var sv_vorstand;
var stop = 0;

function read_form(){
  date = document.getElementById('date_input_1').value;
  place = document.getElementById('sitzung_place_input').value;
  time = document.getElementById('time_input').value;
  sv_vorstand = document.getElementById("sv-vorstand_input_2").value
  get_date(date);
}

function get_date (i_date){
  date_object = new Date(i_date);
  date_wochentag_zahl = date_object.getDay();
  date_wochentag = wochentage[date_wochentag_zahl];
  date_mm = date_object.getMonth() + 1;
  date_yyyy = date_object.getFullYear();
  date_dd = date_object.getDate();
  date_gesamt = date_dd + "." + date_mm + "." + date_yyyy;
}

function read_topic(feld){
  read_topic_cache = document.getElementById('topic_input_' + feld).value;
}

function get_image_data(){
  imgData = "data:image/jpeg;base64,";
}

function error_alert(){
  if (date_wochentag == undefined){
    alert("Bitte fülle das Formular vollständig aus. Du musst ein Datum angeben.");
    stop = 1;
    return;
  }
  if (read_topic_cache == ""){
    alert("Bitte fülle das Formular vollständig aus. Du musst mindestens einen Tagesordnungspunkt angeben.");
    stop = 1;
    return;
  }
}

function genPDF(){
  read_form();
  get_image_data();
  read_topic("1");
  stop = 0;
  error_alert();
  if (stop == 1){
    return;
  }

  var doc = new jsPDF();

  doc.addImage(imgData, 'JPEG', 25, 20, 164, 33, "center"); //!Error ?
  doc.setFontSize(21);
  doc.setFontType("bold");
  doc.text(25,65, 'Einladung zur SV-Sitzung');

  doc.setFontType("normal");
  doc.setFontSize(14);
  doc.text(25,80, 'Liebe Schüler*innen- und Gremienvertreter*innen,'); //hier sonst die Fußnote ¹
  doc.text(25,87, 'hiermit laden wir Euch/Sie herzlich zu unserer SV-Sitzung am');

  doc.setFontType("bold");
  doc.setFontSize(17);
  doc.text(105,98, "" + date_wochentag + ", den " + date_gesamt + " im " + time + ". Block", "center");

  doc.setFontType("normal");
  doc.setFontSize(14);
  doc.text(25, 108, place + " ein.");

  doc.text(25, 120, "Tagesordnung:");

  for (var i = 1; i <= feld; i++){
    if (i < 1){
      read_topic(i);
      doc.text(35, 123, ""+ i + ". "+read_topic_cache);
    }
    else{
      read_topic(i);
      doc.text(35, abstand + i*7, ""+ i + ". "+read_topic_cache);
    }
  }

  doc.text(25, abstand + feld*7 + 10, "Mit freundlichen Grüßen");
  doc.text(25, abstand + feld*7 + 19, sv_vorstand);
  doc.text(25, abstand + feld*7 + 18 + 7*4, "(SV-Vorstand)");

  /*doc.text(25,260, '¹Wir verwenden zum Gendern des generische Femininum.');
  doc.text(25,265, ' Hiermit sind explizit alle Menschen mitgemeint.'); */


  doc.save('Einladung zur SV-Sitzung am ' + date_gesamt + '.pdf');
}

function add_topic() {
 if (feld <= 14) {
  feld++;
 document.getElementById('dynamic_input').innerHTML = "";
  for (var zaehler = 1; zaehler <= feld; zaehler++) {
   var label = "Tagesordnungspunkt " + zaehler;
   var inhalt = document.getElementById("topic_input_" + zaehler).value;
   document.getElementById('dynamic_input').innerHTML +=
    "<label>" + label + ": <input type='text' class='topic_input' id='topic_input_" + zaehler + "' value='" + inhalt +
    "' onInput='speicher(this.value, \"" + feld + "\")'></label><br>";
  }
 }
}

function sub_topic() {
 if (feld >= feldm) {
 feld--;
  document.getElementById('dynamic_input').innerHTML = "";
  for (var zaehler = 1; zaehler <= feld; zaehler++) {
   var label = "Tagesordnungspunkt " + zaehler;
   var inhalt = document.getElementById("topic_input_" + zaehler).value;
   document.getElementById('dynamic_input').innerHTML +=
    "<label>" + label + ": <input type='text' class='topic_input' id='topic_input_" + zaehler  + "' value='" + inhalt +
    "' onInput='speicher(this.value, \"" + feld + "\")'></label><br>";
  }
 }
}